import React from "react";

import { BrowserRouter, Routes, Route,Navigate } from "react-router-dom";

import "../Style/Home.css"
function Home() {
  return (
    <div>
      <div className="container">
        <BrowserRouter>
        <Routes>
            <Route></Route>
            <Route></Route>
        </Routes>
        </BrowserRouter>
        
        <div className="student">Student</div>
      </div>
    </div>
  );
}

export default Home;
